const BpmnJS = window.BpmnJS;
const $ = window.$;
class App extends Component {
  componentWillMount(){
    this.bpmnModeler = new BpmnJS({
      container: '#canvas',
      keyboard: {
        bindTo: window
      }
    });

    $.get(diagramUrl, openDiagram, 'text');
  }
  render() {
    return (
      <div >
       <div id="canvas"></div>
      </div>
    );
  }
}

export default App;
